    public ArrayList<ChartViewMode> parseData() {

        for (int i = 0; i < mJsonDatas.length(); i++) {
            try {
                JSONObject jsonData = mJsonDatas.getJSONObject(i);
                ChartViewMode data = new ChartViewMode();
                data.day = jsonData.getString("day");
                data.open = jsonData.getDouble("open");
                data.high = jsonData.getDouble("high");
                data.low = jsonData.getDouble("low");
                data.close = jsonData.getDouble("close");
                data.volume = jsonData.getDouble("volume");
                mDatas.add(data);
            } catch (JSONException e) {
                Toast.makeText(mContext, "数据解析异常", Toast.LENGTH_SHORT).show();
            }
        }
        return mDatas;
    }

    public static class ChartViewMode {
        public String day;
        public double open;
        public double high;
        public double low;
        public double close;
        public double volume;
    }
